async function TestSessionsSearch() {
  let results = {}
  let checklogins = []
  let allwork = []
  for (var credtmp of creds) {
    allwork.push(async function(cred){
      const logger = winston.createLogger({
        level: 'info',
        format: winston.format.combine(
          winston.format.timestamp(),
          winston.format.printf(info => `${info.timestamp} ${info.level}: ${info.message}`)
        ),
        defaultMeta: { service: cred.Ecommerce},
        transports: [
          //
          // - Write to all logs with level `info` and below to `combined.log` 
          // - Write all logs error (and below) to `error.log`.
          //
          new winston.transports.File({ filename: './testlogs/'+cred.Ecommerce })
        ]
      })
      let testmodule = rewire("./session_cache")
      testmodule.__set__({console:{
        log: function(){
          let loginstance = ""
          for(var arg of arguments){
            loginstance += util.format(arg)
          }
          logger.log("info", loginstance)
        }
      }})
      for (var ntry = 1; ntry <= 2; ntry++) {
        let shit = ntry
        let cshit = cred
        await testmodule.SearchWithSession(
          cred.Ecommerce,
          cred.AccountId,
          cred.UserId,
          cred.Username,
          cred.Password,
          ["fdb4400", "700444"], //["fdb4400"], 
          {
            token: cred.ProxyKey
          }).then((res) => {
          results[cshit.Ecommerce + shit.toString()] = res
        }).catch((e) => {
          logger.log("error",util.format(cshit.Ecommerce, ntry, "got Error", e))
        })
    
    
        await Promise.all(checklogins)
        //  await new Promise((res,_)=>setTimeout(res, 3000))
        logger.log("error",util.format("FINISH GROUP", ntry))
        checklogins = []
        if (ntry === 2) {
          if (!(cred.Ecommerce + "2" in results) || !(cred.Ecommerce + "1" in results)) {
            logger.log("error",util.format( "FirstSearch", !results[cred.Ecommerce + "1"], "SecondSearch", !results[cred.Ecommerce + "2"],
              "for", cred.Ecommerce, "Something went wrong in the some search"))
          } else if (JSON.stringify(results[cred.Ecommerce + "2"].map((r) => {
            delete r["Search_date"]
            return r
          })) != JSON.stringify(results[cred.Ecommerce + "1"].map((r) => {
            delete r["Search_date"]
            return r
          }))) {
            logger.log("error",util.format("For", cred.Ecommerce, "Results do not match"))
            logger.log("error",util.format(cred.Ecommerce, "res1: ", JSON.stringify(results[cred.Ecommerce + "1"])))
            logger.log("error",util.format(cred.Ecommerce, "res2: ", JSON.stringify(results[cred.Ecommerce + "2"])))
          }else{
            if((((results[cred.Ecommerce + "1"] || [])[0] || {}).Application || "").includes('errata')){
              logger.log("info", util.format("Login ERROR", cred.Ecommerce))
            }else if((results[cred.Ecommerce + "1"] || []).length >0){
              logger.log("info", util.format("No error for", cred.Ecommerce))
            }

          }
        }
      }
    }(credtmp).then(()=>{
      donestuff++
    }).catch(()=>{
      donestuff++
    }))
  }
  await Promise.all(allwork)
}